import { Col, Container, Row } from "react-bootstrap";
import "../styles/navbar.css"
const Navbar = () => {
    return (
        <Container>
        <nav className = "navbar">
                <Col ><h1>Analyse Coderhub</h1></Col>
                <Col >
                    <div className="links">
                        <a href="/">Home</a>
                        <a href="/Profile">About</a>
                        <a href="/Profile">Downlaod sheet file</a>
                    </div>
                </Col>
        </nav>
        </Container>
    );
}

export default Navbar;
